    {
        if (!stride && CABLES.isNumeric(v))stride = v;

        const p = this.addInPort(new Port(this, name, Port.TYPE_ARRAY, { "stride": stride }));

        if (v !== undefined && (Array.isArray(v) || v == null)) p.set(v);

        return p;
    }

